import React from "react";
import NavBar from "./NavBar";
import Home from "./Home";
import Acm from "./Acm";
import Controller from "./Controller";
import Login from "./Login";
import AboutUs from "./AboutUs";

const App = () => {
  return (
    <>
      <NavBar />
      <Home />
      <Acm />
      <Controller />
      <AboutUs />
      <Login />
    </>
  );
};
export default App;
